import React from 'react';

const Posts = async () => {
  const response = await fetch("https://strangers-things.herokuapp.com/api/2110-VPI-WEB-PT/posts")
    .then(response => response.json())
    .then(result => {
      console.log(result);
    })
    .catch(console.error);

 
}


export default Posts;
